    e.preventDefault();
  };
  return (
    <div>
      <h1>Add Product</h1>
      <form onSubmit={handleSubmit}>
        <label>
          New Product's Name:
          <input
            type="text"
            value={name}
            onChange={(e) => setName(e.target.value)}
          />
        </label>
        <br />
        <label>
          Product's price:

        </label>
        <br />
        <Link to={`/products/`} className="btn">
          <button type="submit">Add</button>
        </Link>
      </form>
    </div>
  );
};
export default AddProductForm;
